import React from 'react';

const Curriculum = () => {
    const { courses } = props;
    return (
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 bg-yellow-100">
            {
                courses.map(course =>
                <div>
                <h3>Course Title</h3>
                <img src="./favicon.png" alt="Tech" />
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                    <li>5</li>
                    <li>6</li>
                    <li>7</li>
                </ul>
            </div>)
            }
        </div>
    );
};

export default Curriculum;
